import React from 'react'
import TableData from './TableData'

function TableRow({ userContact }) {
    const userContactKeys = Object.keys(userContact)

    userContact.map((userContactData) => {
        if (userContactKeys !== 'userId' && userContactKeys !== 'contactId') {
            if (userContactKeys === 'profile') {
                console.log(userContactData[userContactKeys])
                return (
                    <td>
                        <img
                            src={userContactData[userContactKeys]}
                            alt="user-profile"
                            className="profile-pic"
                        />
                    </td>
                )
            } else {
                return <td>{userContactData[userContactKeys]}</td>
            }
        }
    })

    return (
        <tr>
            {
                // return <TableData />
            }
        </tr>
    )
}
export default TableRow
